ISLAMABAD, Jan 28 (APP):Chairman Joint Chiefs of Staff Committee (CJCSC) General Nadeem Raza Tuesday called on King Salman bin Abdul Aziz Al Saud during his official visit to Kingdom of Saudi Arabia (KSA), an Inter Services Public Relations (ISPR) press release said.
Both the dignitaries discussed matters of mutual interest during the meeting.
